const gamesLost = 0;
const userName = 0;
const gamesWon = 0;
const newGame = 0;
const viewScores = 0;
const logOut = 0;

function ViewScores() {
  return (
    <div>
       <div className='right-sqr'>
          <h2> Poker Game </h2>
          <h3> {userName} Score History</h3>
          <h4> Game Won: {gamesWon}</h4>
          <h4> Game Won: {gamesLost}</h4>
        </div>

      <div className='left-sqr'>
        <button onClick={newGame}>New Game</button>
        <button onClick={viewScores}>View Scores</button>
        <button onClick={logOut}> Log Out</button>

      </div>
    </div>
  )
}

export default ViewScores
